INSERT INTO `portfolios` (`id`, `icon`, `image`, `title`, `content`, `bullet_1`, `bullet_2`, `bullet_3`, `bullet_4`, `type`, `is_show`, `order_by`, `comments`, `parent_id`, `lft`, `rgt`, `depth`, `created_at`, `updated_at`) VALUES
(5, 'portfolio/b41bd29233aa60cc2eb5b1782e383ff7.webp', 'portfolio/09a65f76f1e1973d4a34130592e666aa.webp', 'City Associates', 'City Associates is a real estate application by AppsNation where all the information about City Associates projects are available. You can view all types of properties like Flats, Plots, Houses and get complete detail about it with photos and videos. If you wish to purchase any property or have queries regarding it then you can connect directly with the estate agent through this app.', 'Live view of all projects.', 'Photos and videos.', 'Live chat with estate agents', 'Online booking', 'Mobile', 0, NULL, NULL, NULL, 30, 31, 1, '2022-05-25 09:34:28', '2024-07-04 04:08:11'),
(6, 'portfolio/7276cd8b896f98251f10c689695c1cf1.webp', 'portfolio/5231f01abb602cabff56f767d31739a6.webp', 'Flappy Bird', 'Flappy Bird is an online Gaming store designed by Appsnation. This app provides multiple games for all age groups. You can sign up and play games as much as you want. What\'s unique about the Flappy Birds Game Store application is that it has \"Play-to-earn\" games which means you can also utilize your points which you earn while playing games in purchasing products or get them credited as cashback to your account. It\'s a unique concept where you can play and win.', 'Play to earn.', 'Multiple games category.', 'Cashback.', 'Player Reviews.', 'Game', 0, NULL, NULL, NULL, 28, 29, 1, '2022-05-25 10:14:36', '2024-07-04 04:08:11'),
(7, 'portfolio/9530f8986e0172e7a3b21555afbbfd21.webp', 'portfolio/b6f19625db8ea2eb5bba45fa6eb98ac6.webp', 'AHA Fasting', 'AHA Fasting is a smart and easy to use application to keep up with your diet and lifestyle. This app assists you in maintaining a good diet and lifestyle as well as makes sure that you remain fit by performing regular exercises.  It is highly accurate and retrieves real-time information on what you can eat. AHA Fasting also offers numerous exercises, yoga, articles on diet and nutrition related issues as well as a big community of supportive users.', 'Fitness Guides.', 'Track Performance.', 'Community Management.', 'Easy to use.', 'Mobile', 0, NULL, NULL, NULL, 26, 27, 1, '2022-06-08 07:00:59', '2024-07-04 04:08:11'),
(9, 'portfolio/0e057573d7ec400130e8e7bf3496d3b1.webp', 'portfolio/8b0f89c9d7bec6fb2a400081342b1f21.webp', 'Ride Sharing App', 'This is an innovative ride share application designed and developed by appsnation. Vero is a ride share app that works in a unique way. It acts as a single-pool as well as a multi-pool service, where you can arrange a ride for yourself. This app also allows you to shop online and have goods delivered to your doorstep at the same time by connecting to online stores using this application.', 'Online Car Booking.', 'Real time tracking.', 'Secure Payment.', 'Online Shop.', 'Mobile', 0, NULL, NULL, NULL, 32, 33, 1, '2022-06-09 06:58:18', '2024-07-04 04:08:11'),
(10, 'portfolio/42b406a200ce490a6c7f77494cb2ba57.png', 'portfolio/ae53df21623221ed779e7f7c80b90ede.webp', 'Toy sort', 'Toy sort is a 3D puzzle game in which you have to select the required items from the messy pile and sort them out to win. The game is simple to play, but very challenging. Toy sort is a simple, fun and addictive toy puzzle game developed by appsnation. The goal of toy sort is to line up all the toys in their correct spots while collecting as many stars as possible. Removing a toy in one spot may affect another stack and cause them to fall down!', 'Colorful User Interface.', 'Engaging Complex levels', 'Realistic sounds', 'Sorting skills improve', 'Game', 0, NULL, NULL, NULL, 34, 35, 1, '2022-06-09 11:12:02', '2024-07-04 04:08:11'),
(12, 'portfolio/e7d04f3d943c6f0786489878033fc410.webp', 'portfolio/81d6c9be41657bc7032821164309b220.webp', 'AR Anatomy App', 'AR Anatomy is a human anatomy-based app that will help you to understand the human body anatomy with the help of AR technology. It scans the whole human body then tells you the detailed exploration of Human organ systems working on the 3D model. \r\n\r\nIt describes you in easy-to-understand descriptions that will explain to you about the different organ systems like\r\n\r\n\r\n Bones â˜… Ligaments â˜… Joints â˜… Muscles â˜… Circulation (arteries, vein and heart)\r\nâ˜… Central nervous system â˜… Peripheral nervous system â˜… Sense organs\r\nâ˜… Respiratory â˜… Digestive â˜… Urinary  â˜… Reproductive ( both male and female)', 'AR Technology.', '3D Model.', 'Organ System Information.', 'Interactive UI.', 'AR/VR', 0, NULL, NULL, NULL, 36, 37, 1, '2022-06-09 11:12:28', '2024-07-04 04:08:11'),
(13, 'portfolio/350f96aab03ebfa046d6cbda8f10a4f8.webp', 'portfolio/2568114c5d0873a010791c97a50e43d5.webp', 'War Hero Game', 'War Hero Rescue Survivor Pull The Sticks is a unique fantasy puzzle game in which there is one hero who has to save his princess by crossing different hurdles.\r\nItâ€™s a hero war rescue game. In this game, some sticks will act as a hurdle in your path. \r\nThe game was designed as a fantasy puzzle that has different levels and every new level will be harder than the previous one will make the person addicted because he would have an addiction to unlock the new level.\r\nThe concept of the game is to unlock the different levels of the game by saving the princess by surpassing the different hurdles.', 'Unique Fantasy Puzzle.', 'Different levels.', 'Increasing strategic skills.', 'Interactive UI.', 'Game', 0, NULL, NULL, NULL, 38, 39, 1, '2022-06-09 11:12:35', '2024-07-04 04:08:11'),
(15, 'portfolio/9b96b933fcf30f81de349b8a3496e9fa.webp', 'portfolio/46e73af55e964f1bc248ee3014e2e18b.webp', 'Plecea Furniture App', 'Placea is a furniture app where you can see the furniture at a 360-degree angle with the help of AR technology before going to buy. Placea will show you a 360-degree 3D view of furniture so you can experience it without even touching it. You can set up furniture, shelving systems, and decorations and change the color of the walls as well before exporting your design in both 3D and 2D.', 'Showcase 2D and 3D models.', 'Color modification option.', 'AR mode availability.', 'Interaction with goods.', 'AR/VR', 0, NULL, NULL, NULL, 40, 41, 1, '2022-06-13 19:26:25', '2024-07-04 04:08:11'),
(16, 'portfolio/213575e6453abff13e7969ebb377be17.webp', 'portfolio/0d56a1100ca6f905a1d306940f75c2ea.webp', 'ERP', 'It\'s an Erp solution is help you to manage all your office tasks. It\'s a one-stop solution that can help SMEs make a Simple, Secure and Cost-Effective Cloud office. Now, you can transform your office into a full-fledged digital office with the help of this ERP solution. It manages your files and shares content, and you can also communicate via chat or video call in this system.', 'File Sharing', 'Attendance System', 'Data Protection', 'Chat or Video call', 'Web', 0, NULL, NULL, NULL, 24, 25, 1, '2022-06-13 21:58:29', '2024-07-04 04:08:11'),
(17, 'portfolio/38f4885df8be8c3361666d92db6f2007.webp', 'portfolio/8009665887d2cd3fff088c942d858bc0.webp', 'Legal Service', '416 legal service, a complete paralegal system where you can find your desired solution to any problems within a few minutes like smart claims court, landlord and tenant, traffic ticket service, provincial offenses, and Employment law.', 'Provincial offenses', 'Employment Law', 'Affidavits & Notarization', 'Traffic Ticket Service', 'Web', 0, NULL, NULL, NULL, 22, 23, 1, '2022-06-13 22:04:52', '2024-07-04 04:08:11'),
(18, 'portfolio/144ef75737c7fc09d3e15acdc8a68a2c.webp', 'portfolio/84f5b05e6f7fb52913b0f063192ef477.webp', 'Cake milkshake site', 'Roll me up is a complete solution for those who want to get their goods from home. This website and app have many amazing features that will help the seller easily sell their product without any hassle. It has online payment integration. Everyone can choose their favourite product on this website by passing a few simple steps. Due to its attractive user interface, everyone can easily connect with that website', 'Online Payment option', 'Product ratings and reviews', 'Easy Checkout Process', 'Easy Desserts Categorization', 'Web', 0, NULL, NULL, NULL, 42, 43, 1, '2022-06-13 22:09:03', '2024-07-04 04:08:11'),
(19, 'portfolio/02f8c04b3a811f6f63099227cfb5efe2.webp', 'portfolio/306c929361581abb6c69735a3f078941.webp', 'Zombie Smasher Squad Roadkill', 'Zombie Smasher Squad Roadkill is a survival game in which you have to survive in a town where a lot of zombies will be present there. In the town, only a few uninfected people and you will be alive. You have to save the remaining uninfected people by saving yourself from zombies as well. In this game you have two options for defense one is Car and the second is a gun.', 'Colorful User Interface.', 'Different levels.', 'Realistic sounds.', 'Problem Solving.', 'Game', 0, NULL, NULL, NULL, 44, 45, 1, '2022-07-05 17:28:07', '2024-07-04 04:08:11'),
(20, 'portfolio/9e53aca0f3e2b2160ce47399ef3aaa59.webp', 'portfolio/d87f5580fbcf3ce41a4fc8c1b68cb22d.webp', 'Scary Evil Possessed House', 'Scary Evil Possessed House is a scary or horror game in which youâ€™ll see a haunted horror that is possessed by many ghosts. Itâ€™s a survival horror house game. You have to escape from the haunted horror house which is possessed by many ghosts and witches. Many clues or hints will be given in this house you have to utilize them by hiding from the ghosts. \r\n\r\nYou have to find the keys in the horror house once you find the key then you can unlock the rooms and go to the next level. You have to be very careful while searching for the keys of the rooms because every single inch or side of a house is possessed by many witches and scary ghosts. The only way is to survive in this game is to escape from the haunted house.', 'Brain Testing Puzzles.', 'Perfect 3D graphics.', 'Realistic visual effects.', 'Scary sound effects.', 'Game', 0, NULL, NULL, NULL, 46, 47, 1, '2022-07-06 20:43:48', '2024-07-04 04:08:11'),
(21, 'portfolio/2df3382d0e02d9560fea63668967952c.webp', 'portfolio/8a3318e3aaa3e47b9b097745503eec9d.webp', 'Prison Escape Games Jail Break', 'Prison Escape Games Jail Break is a prison survival game. In this game, youâ€™re a prisoner. In this game, you have to escape from prison. This is a survival action game in this game youâ€™ll see a prison with a lot of security, there will be some security cameras, guards, and police sirens in the prison that will stand against your escape plan.', '3D smooth performance.', 'Easy controls.', 'Live prison life.', 'Strong moves.', 'Game', 0, NULL, NULL, NULL, 48, 49, 1, '2022-07-06 21:09:52', '2024-07-04 04:08:11'),
(22, 'portfolio/3e0726d615f98b3de91fef95eb29af64.webp', 'portfolio/c5419f85ed56928dd55d3a52e56fc712.webp', 'Travel Agency App', 'Travelicious stands out as the ultimate travel planning tool, designed to cater to the diverse needs of modern travelers. From booking flights and accommodations to discovering local attractions and hidden gems, Travelicious simplifies every step of your journey. Our commitment to user experience excellence ensures that every interaction with the app is intuitive, efficient, and tailored to enhance your travel experience. With Travelicious, travel planning becomes not just a task but an enjoyable part of your adventure.', 'Booking', 'Promotions & Discounts', 'Payment Gateways', 'Mortgage', 'Mobile', 1, NULL, 'case-studies/travel-agency-app', NULL, 20, 21, 1, '2024-05-21 14:18:25', '2024-07-30 14:23:57'),
(23, 'portfolio/2c935013aad64dd3a08c6eb825a904b4.webp', 'portfolio/f1cffb42df6929af87b6abd974a96889.webp', 'Travel Agency Web', 'Introducing Travelicious, your ultimate travel web for seamless planning and unforgettable adventures. From personalized recommendations tailored to your preferences, to easy booking and exclusive deals, Travelicious ensures that every journey is hassle-free and filled with excitement. Explore with confidence and discover new horizons with Travelicious by your side. Start your next travel experience today and transform the way you explore the world.', 'Dashboard', 'Content Management', 'User Management', 'Service Management', 'Web', 0, NULL, 'case-studies/travel-agency-web', NULL, 18, 19, 1, '2024-05-21 14:54:25', '2024-07-30 14:23:50'),
(24, 'portfolio/2a4f9755820fcefc35bd00768574e304.webp', 'portfolio/aa62815704501c87dae7394581422a4b.webp', 'Real Estate App', 'Discover a simpler way to navigate real estate with our mobile app, designed to streamline the buying, selling, and renting process. Our app combines detailed property listings, a convenient mortgage calculator, and map integration into a user-friendly interface that makes real estate decisions easier and more accessible. Explore the features that set us apart and enhance your property search experience.', 'Search Properties', 'Property Information', 'Map Integration', 'Payment Gateways', 'Mobile', 0, NULL, 'case-studies/real-estate-app', NULL, 16, 17, 1, '2024-06-03 14:36:02', '2024-07-30 14:23:44'),
(25, 'portfolio/eb1a6061c3f8d0e15e2c3a214e7dec40.webp', 'portfolio/a9f1a1ddc85a019623dda2d32c1c008f.webp', 'Real Estate Web', 'Avenue Is The Best Application Which Provides A Complete Guide For Purchasing And Selling Of Properties. Discover Avenue, the premier app for effortless property transactions. With a user-friendly interface, comprehensive listings, and powerful tools, we make buying and selling properties straightforward and efficient. Join us and navigate the real estate market with confidence and ease.', 'Dashboard', 'Properties Management', 'Mortgage', 'User Management', 'Web', 0, NULL, 'case-studies/real-estate-web', NULL, 14, 15, 1, '2024-06-14 14:36:05', '2024-07-30 14:23:37'),
(26, 'portfolio/e54f8cf3254e38f44180aecc842ec9f5.webp', 'portfolio/1258c9448b2d92a3d019c9c857e1ee13.webp', 'Loyalty App', 'Discover a new level of shopping with Bonus Buddy. Enjoy exclusive cashback rewards, personalized deals, and a seamless experience across your favorite e-commerce platforms. Our intuitive app ensures you never miss out on the best offers tailored just for you, making your shopping journey more enjoyable and efficient. Easily track your rewards and savings in real-time, browse curated recommendations that match your preferences, and unlock special bonuses with every purchase. Share your favorite finds with friends and join a community of savvy shoppers who value smart spending and great deals. Shop smarter, save more, and make every purchase rewarding. Welcome to a superior shopping journey with Bonus Buddy, where your loyalty is always appreciated and rewarded!', 'Promotional Offers', 'Rewards', 'Discounts', 'Earn & Redeem Points', 'Mobile', 0, NULL, 'case-studies/loyalty-app', NULL, 12, 13, 1, '2024-06-24 15:36:47', '2024-07-30 14:23:31'),
(27, 'portfolio/bc40d0c0a0b1167b8b5ae7d6d99f87bb.webp', 'portfolio/449c1de84565c2dba2e3a7d96260766b.webp', 'Loyalty Web', 'Bonus Buddy goes beyond just offering cashback deals; it\'s about building a trusted relationship with our users. Our commitment to excellence is reflected in every aspect of the app, from the intuitive interface that simplifies your shopping journey to the robust security measures safeguarding your transactions. Experience peace of mind as you shop with Bonus Buddy, knowing that we\'re dedicated to providing you with a seamless, rewarding, and secure experience every time you use our app. Join Bonus Buddy today and discover a new level of convenience and savings in your shopping endeavors.', 'Dashboard', 'Content Management', 'Promotions', 'Reviews', 'Web', 0, NULL, 'case-studies/loyalty-web', NULL, 10, 11, 1, '2024-06-24 15:40:32', '2024-07-30 14:23:23'),
(28, 'portfolio/3d43adb4ff31b40211d4241474705c85.webp', 'portfolio/0872333c7b48a24b4e6b15d2e4fa26e3.webp', 'Gym App', 'More than just a fitness app, Gymnasium acts as your personal trainer, nutritionist, and motivational coachâ€”all conveniently housed within a user-friendly interface. We understand that starting and sticking to a fitness regimen can be challenging, which is why Gymnasium simplifies the complexities of fitness, making it accessible and enjoyable for everyone, anywhere, and anytime. From personalized workout plans tailored to your fitness level and goals to expert dietary recommendations, Gymnasium empowers you to take charge of your health with confidence and ease.', 'Management of Profile', 'Management of Timeline', 'Meal Plan', 'View Recipes', 'Mobile', 0, NULL, 'case-studies/gym-app', NULL, 8, 9, 1, '2024-07-04 03:52:15', '2024-07-30 14:23:15'),
(29, 'portfolio/8713aea6c424c0afffb6278e43dfab15.webp', 'portfolio/68ac3aae04ae4aa9e21833d7922d4df2.webp', 'Gym Web', 'Gymnasium emerges as the definitive application dedicated to offering a comprehensive guide for enhancing physical health and overall well-being. This platform excels by integrating innovative tools and expert insights designed to empower users on their journey toward optimal fitness and wellness. Engage with Gymnasium to transform your health through structured guidance and supportive community features. Whether you\'re starting your fitness journey or aiming to reach new goals, Gymnasium provides the tools and support you need to succeed. From personalized workout plans to expert nutritional advice and real-time progress tracking, it\'s your all-in-one companion for achieving and maintaining a healthier lifestyle.', 'Content Management', 'User Management', 'Promotions', 'Bookings Management', 'Web', 1, NULL, 'case-studies/gym-web', NULL, 6, 7, 1, '2024-07-04 04:02:37', '2024-07-30 14:23:08'),
(30, 'portfolio/a3e73e5a1ca266a367d9f888156610fd.webp', 'portfolio/16cb744f819ed9f6b159c347c780e015.webp', 'Mover App', 'Develop a comprehensive mobile application designed to optimize the moving experience by facilitating efficient order management and customer engagement. The app aims to provide seamless real-time tracking of movers, an intuitive interface for profile customization, and direct feedback channels to improve service quality. Additionally, it seeks to incorporate membership and subscription features to offer value-added services and promotions, thereby enhancing customer loyalty and operational transparency in the moving industry.', 'Order Management', 'Track Order', 'Membership & Subscription', 'Nearby Courier', 'Mobile', 1, NULL, 'case-studies/mover-app', NULL, 4, 5, 1, '2024-07-04 04:05:18', '2024-07-30 14:23:02'),
(31, 'portfolio/955550f61d026a5753ea0b742acbe4bc.webp', 'portfolio/0448cf4b9e1eafc1103a70d60eef41d0.webp', 'Mover Web', 'At Mover App, our mission is clear, revolutionize the moving experience. With a steadfast commitment to innovation, we\'ve crafted a seamless platform that bridges the gap between customers and reliable moving professionals. Our dedication to excellence ensures that every interaction, from booking to the final move-in, is smooth, efficient, and stress-free. Join us as we transform the way people move, one seamless connection at a time.', 'Riders Management', 'Promotions', 'Nearby Courier', 'Track Order', 'Web', 1, NULL, 'case-studies/mover-web', NULL, 2, 3, 1, '2024-07-04 04:07:49', '2024-07-30 14:22:55');
